import SneakerCard from "./SneakerCard"
import React from 'react';

function SneakerList({sneakers, currentUser, handleComments,sendComments,handleDelete}){

   const onSearch =(e)=>{
    setSearch(e.target.value)
   }



const sneakerComponents = sneakers.results && sneakers.results.map(sneaker => {
   return <SneakerCard
   sneaker={sneaker}
    currentUser={currentUser}
    handleComments={handleComments}
    sendComments={sendComments}
    handleDelete={handleDelete}
   key={sneaker.id}
    />
})


return(
<>
  <input onChange={onSearch} type="search" placeholder="search Shoes..."></input>
<div className="components">
  {sneakerComponents}
</div>
    </>
)

}


export default SneakerList;
